def input_fn(data_file, num_epochs, shuffle, batch_size, feature_only=False):
  """Generate an input function for the Estimator."""
  assert tf.gfile.Exists(data_file), (
      '%s not found. Please make sure you have run data_download.py and '
      'set the --data_dir argument to the correct path.' % data_file)

  def parse_csv(value):
    # print('Parsing', data_file)
    columns = tf.decode_csv(value, record_defaults=_CSV_COLUMN_DEFAULTS)
    features = dict(zip(_CSV_COLUMNS, columns))
    labels = features.pop('r_rank')
    return features, labels

  # Extract lines from input files using the Dataset API.
  dataset = tf.data.TextLineDataset(data_file) # read line by line
  if shuffle:
    dataset = dataset.shuffle(buffer_size=_NUM_EXAMPLES['train'])

  dataset = dataset.map(parse_csv, num_parallel_calls=16)

  # We call repeat after shuffling, rather than before, to prevent separate
  # epochs from blending together.
  dataset = dataset.repeat(num_epochs)

  dataset = dataset.batch(batch_size)
  iterator = dataset.make_one_shot_iterator()
  features, labels = iterator.get_next()

  if feature_only:
      return features
  else:
      return features, labels


def calculate_alpha(test_file, col_index):
    cut = subprocess.Popen('cut -d , -f %s %s'%(col_index, test_file), stdout=subprocess.PIPE, shell=True)
    out = cut.communicate()[0].decode().split()
    cut.wait()
    c = Counter(out)
    c = sorted(c.items(), key=lambda tup:tup[0])
    inv_freq = [1./float(tup[1]) for tup in c]
    total = 0.
    for inv in inv_freq: total += inv
    res = [round(inv/float(total), 5) for inv in inv_freq]
    return res

def get_labels(data_file):
    label_ind = _CSV_COLUMNS.index('r_rank')
    label_col = pd.read_csv(data_file, usecols=[label_ind], header=None)
    labels = label_col.values
    return reshape(labels, [-1])


